  render () {
const {itemsSold} = this.props
    return (
      <div className="sold-watches">
    <div className="items">
      {itemsSold.map(item =>
          <Item
            key={item.id}
            item={item}
            />
        )}
    </div>
    </div>
    )
  }
}

export default SoldWatches;
